import React from 'react'
import styled from "@emotion/styled";

const Container = styled.div`
    background-color: #aaa;
`

const GlobalCases = ({ nr }) => {
    return (
        <Container>Global Cases: {nr}</Container>
    )
}

export default GlobalCases
